package com.home.commonBase.table.result;
import com.home.shine.data.DateData;
import com.home.shine.table.BaseDBResult;

/** 全局表(generated by shine) */
public class GlobalDBResult extends BaseDBResult
{
	/** 默认主键 */
	public int key;
	
	/** 数据结构版本 */
	public int dataVersion;
	
	/** 上次保存时间 */
	public DateData saveDate;
	
	/** blob值 */
	public byte[] data;
	
	@Override
	protected void toReadValues()
	{
		key=readInt();
		dataVersion=readInt();
		saveDate=readDate();
		data=readBytes();
	}
	
	@Override
	public Object getPrimaryKeyByIndex(int index)
	{
		switch(index)
		{
			case 0:
				return key;
		}
		
		return null;
	}
	
}
